widgets.onValue:
// Retrieve stored tap times
let tapTimesRaw = get('tapStorage');
let tapTimes = [];

try {
    if (tapTimesRaw) {
        tapTimes = JSON.parse(tapTimesRaw);
    }
} catch (e) {
    tapTimes = [];
}

// Record the current time
const now = Date.now();

// Reset if the last tap was more than 3 seconds ago
if (tapTimes.length > 0 && now - tapTimes[tapTimes.length - 1] > 3000) {
    tapTimes = [];
}

// Add the current tap
tapTimes.push(now);

// Keep only the last 4 taps
if (tapTimes.length > 4) {
    tapTimes.shift();
}

// Store the updated tap times
set('tapStorage', JSON.stringify(tapTimes));

// Proceed with calculations only if at least 3 taps are recorded
if (tapTimes.length >= 3) {
    let intervals = [];
    for (let i = 1; i < tapTimes.length; i++) {
        intervals.push(tapTimes[i] - tapTimes[i - 1]);
    }
    const avgInterval = intervals.reduce((a, b) => a + b, 0) / intervals.length;
    const bpm = Math.round(60000 / avgInterval);

    // Update the BPM display
    set('bpmDisplay', bpm);

    // Update the interval display
    set('intervalDisplay', `${Math.round(avgInterval)}`);
}
